import { Formik } from "formik";
import ClientMaper from "../../mappers/Client/Client";
import { useState, useCallback } from "react";
import { Dialog, DialogTitle,DialogContent } from "@material-ui/core";


const DialogCreateClient = ({open, onClose, onCreated}) =>{
    const [openAlert, setOpenAlert] = useState(false);
    const [alertMessage, setalertMessage] = useState("");
    const [alertSeverity, setalertSeverity] = useState("Success");

    const onSave = useCallback((values, actions) =>{},[]);

    return(
        <>
        <Formik 
        initialValues={ClientMaper.CreateToObject}
        enableReinitialize={true}
        isSubmitting={true}
        onSubmit={(values, actions)=>{
            onSave (values,actions);
        }}
        >
            {({submitForm, resetForm, isSubmitting})=>{
                <Dialog
                open={open}
                maxWidth="lg"
                fullWidth={true}
                onClose = {(event, reason)=>{
                    if(reason !== "backdropClick"){
                        onClose(event, reason);
                        resetForm();
                    }
                }
                }
                >
                    <DialogTitle>Crear Cliente</DialogTitle>
                    <DialogContent>

                    </DialogContent>
                </Dialog>
            }}
        </Formik>
        </>
    )
} 
export default DialogCreateClient;
